import React from 'react';
import './GameTable.css';
//Components
import Game from './Game.js';

const GameTable = () => {
    const game = {title:'God of var',genre:'Actions',played:true};


    return (
        <div>
            <h1>Game Database</h1>
            <table class="table">
                <thead>
                    <tr>
                    <th scope="col">Title</th>
                    <th scope="col">Genre</th>
                    <th scope="col">Played ?</th>
                    <th scope="col">Action</th>
                    </tr>
                </thead>
                <tbody>
                    <Game props={game} />
                    <Game props={game} />
                    <Game props={game} />
                    <Game props={game} />
                    <Game props={game} />

                </tbody>
            </table>

        </div>
    );
};

export default GameTable;
